import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';
import Layout from './components/Layout'; // Import Layout

// Placeholders (Keep these as they were)
const Home = () => <div className="container"><h1>Landing Page (Coming Soon)</h1></div>;
const Login = () => <div className="container"><h1>Login Page</h1></div>;
const Register = () => <div className="container"><h1>Register Page</h1></div>;
const AdminDashboard = () => <div className="container"><h1>Admin Dashboard</h1></div>;
const UserDashboard = () => <div className="container"><h1>User Dashboard</h1></div>;
const About = () => <div className="container"><h1>About Page</h1></div>;
const Cars = () => <div className="container"><h1>Car Listing</h1></div>;
const NotFound = () => <div className="container"><h1>404 Not Found</h1></div>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <Layout> {/* Wrap everything in Layout */}
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/about" element={<About />} />
            <Route path="/cars" element={<Cars />} />

            <Route 
              path="/user/*" 
              element={
                <PrivateRoute roleRequired="user">
                  <UserDashboard />
                </PrivateRoute>
              } 
            />

            <Route 
              path="/admin/*" 
              element={
                <PrivateRoute roleRequired="admin">
                  <AdminDashboard />
                </PrivateRoute>
              } 
            />

            <Route path="*" element={<NotFound />} />
          </Routes>
        </Layout>
      </Router>
    </AuthProvider>
  );
}

export default App;
